import { connect } from 'react-redux';

import { deleteUserData } from '../../redux/user/actions'

export const render = () => {
  deleteUserData();
  return null;
}

const mapStateToProps = () => {};

const mapDispatchToProps = dispatch => ({
	saveUserData: payload => dispatch(deleteUserData(payload)),
});


export default connect(
	mapStateToProps,
	mapDispatchToProps
)(render);
